            "text": "<p><span style=\"font-size:20px\"><span style=\"color:#22a6b3\">تفاوت بیمه بدنه با شخص ثالث چیست ؟ </span></span></p>\n\n<p><span style=\"color:#000000\"><span style=\"font-size:16px\">دلایل اهمیت بیمه بدنه چیست و کاربرد آن مربوط به چه زمانی است؟</span></span></p>\n",
